  wgAPI.genTimeStamp = function (time) {
    if (!time) {
      time = Date.now()
    }
    if (time instanceof Date) {
      time = time.getTime()
    } else if (typeof time === 'number') {
      //do nothing
    } else {
      throw new Error('time type not support ' + typeof (time))
    }
    return Math.floor(time / 1000)
  }
