  // 赛尔号支付 payType 1 == 微信支付  2 == 支付宝支付  3 == 爱贝支付  4 == 米米卡支付  5 == 米币支付 米币支付时需要填mimiId（米米号）
  wgAPI.seerPay = function (uid, token, gameId, back_url, productId, channel, payType, card_id, card_psd, mimiId, vflag) {
    if (!token) {
      token = wgAPI.getItem('token')
    }
    if (!channel) {
      channel = wgAPI.getItem('channel')
    }
    if (!gameId) {
      gameId = wgAPI.gameId
    }
    if (!back_url) {
      back_url = window.location.href
    }
    if (!payType) {
      alert('请指定支付类型')
      return
    }
    if (!productId) {
      alert('请选择要购买的商品')
      return
    }
    var url = ''
    if (1 == payType) {
      url = wgAPI.apiURL + '/pay/wxpaySeer?' +
        'uid=' + uid +
        '&mimi_id=' + mimiId +
        '&svrId=' + 1 +
        '&token=' + token +
        '&game_id=' + gameId +
        '&timeSpan=' + Date.now() +
        '&product_id=' + productId +
        '&channel=' + encodeURIComponent(channel) +
        '&back_url=' + encodeURIComponent(back_url) +
        '&time=' + Date.now()
    } else if (2 == payType) {
      url = wgAPI.apiURL + '/pay/alipaySeer?' +
        'game_id=' + gameId +
        '&uid=' + uid +
        '&mimi_id=' + mimiId +
        '&svrId=' + 1 +
        '&token=' + token +
        '&product_id=' + productId +
        '&back_url=' + encodeURIComponent(back_url) +
        '&channel=' + encodeURIComponent(channel) +
        '&timeSpan=' + Date.now()
    } else if (3 == payType) {
      url = wgAPI.apiURL + '/pay/iapppaySeer?' +
        'game_id=' + gameId +
        '&uid=' + uid +
        '&mimi_id=' + mimiId +
        '&svrId=' + 1 +
        '&token=' + token +
        '&product_id=' + productId +
        '&back_url=' + encodeURIComponent(back_url) +
        '&channel=' + encodeURIComponent(channel) +
        '&timeSpan=' + Date.now()
    } else if (4 == payType) {
      if (!card_id) {
        alert('卡号不能为空')
        return
      }
      if (!card_psd) {
        alert('密码不能为空')
        return
      }
      url = wgAPI.apiURL + '/pay/taomeepaySeer?' +
        'game_id=' + gameId +
        '&uid=' + uid +
        '&mimi_id=' + mimiId +
        '&svrId=' + 1 +
        '&token=' + token +
        '&product_id=' + productId +
        '&back_url=' + encodeURIComponent(back_url) +
        '&channel=' + encodeURIComponent(channel) +
        '&card_id=' + card_id +
        '&card_passwd=' + card_psd +
        '&timeSpan=' + Date.now()
    } else if (5 == payType) {
      var nowTs
      if (MFC && MFC.serverTimer) {
        nowTs = MFC.serverTimer.getTime()
        console.log('ts:' + nowTs)
      }
      if (!nowTs) {
        nowTs = Date.now()
      }
      url = wgAPI.apiURL + '/pay/consumetaomeecoin?' +
        'game_id=' + gameId +
        '&uid=' + uid +
        '&svrId=' + 1 +
        '&token=' + token +
        '&product_id=' + productId +
        '&back_url=' + encodeURIComponent(back_url) +
        '&channel=' + encodeURIComponent(channel) +
        '&mimi_id=' + mimiId +
        '&pwd=' + card_psd +
        '&timeSpan=' + nowTs
    } else if (6 == payType) {
      url = wgAPI.apiURL + '/pay/wxapppaySeer?' +
        'uid=' + uid +
        '&mimi_id=' + mimiId +
        '&svrId=' + 1 +
        '&token=' + token +
        '&game_id=' + gameId +
        '&timeSpan=' + Date.now() +
        '&product_id=' + productId +
        '&channel=' + encodeURIComponent(channel) +
        '&back_url=' + encodeURIComponent(back_url) +
        '&vflag=' + vflag +
        '&time=' + Date.now()
    } else if (9 == payType) {
      url = wgAPI.apiURL + '/pay/AppStorePaySeer?' +
        'uid=' + uid +
        '&mimi_id=' + mimiId +
        '&svrId=' + 1 +
        '&token=' + token +
        '&game_id=' + gameId +
        '&timeSpan=' + Date.now() +
        '&product_id=' + productId +
        '&channel=' + encodeURIComponent(channel) +
        '&back_url=' + encodeURIComponent(back_url) +
        '&time=' + Date.now()
    } else {
      alert('目前尚不支持该支付渠道，请选其他支付方式')
      return
    }
    return url
  }

